The University of Birmingham invites tenders for supply of a 3-year maintenance, service and support contract for the 3T Siemens Prisma MRI scanner at the Centre for Human Brain Health, University of Birmingham.

The contract provider will be able to fully service, repair, and troubleshoot any issues associated with this system, as well as supporting the Centre to develop its MR research. The provider will ensure a quality customer service level and will ensure the system and its operators are fully supported. This will include emergency response, parts, and on-site attendance. In addition to this, we require training and assistance for new scanning protocols including those directed purely towards research applications, remote monitoring of helium levels and automated fault detection.

This project may be funded by the European Regional Development Fund (ERDF) or;
-	European Structural and Investment Fund (ESIF) or;
-	Research Councils UK (RCUK), the strategic partnership of the UK's seven Research Councils.

Please refer to Appendix A for full specification of requirements via https://in-tendhost.co.uk/universityofbirmingham/aspx/Home
